import React from "react";

const Table = () => {
  return(
    <table className="table table-striped mt-5">
      <thead>
        <tr>
          <th>Task</th>
          <th></th>
          </tr>
          </thead>
          <tbody ></tbody>
          </table>
  )
}

export default Table;
